    OCTOBER MONTHLY REPORT (09/01/2012 - 09/30/2012), RECEIVED 02/21/2013  Dear Mr.
    Butler:  In response to your question concerning NACSPACs reporting of contributions
    to Bill Cassidy for Congress on 9/10/12 for $1,500 and Rodney Alexander for Congress
    Inc.  on 9/19/12  for $2,500 please see the additional information below.    On
    1/23/13, NACSPAC received from Bill Cassidy for Congress a refund in the total
    amount of the contribution to him, $1,500.  NACSPAC reported this receipt in the
    February monthly report.   Congressman Alexander ran in the general election,
